sys_variable_value.value:
(function execute(inputs, outputs) {
  var req=inputs.request;
outputs.product = req.productId;
gs.info("The requested product is " + outputs.product);
outputs.variant = req.variantId;
gs.info("The requested product is " + outputs.variant);
outputs.ppt = req.paymentTerm;
gs.info("The requested product is " + outputs.ppt);
outputs.pt = req.policyTerm;
gs.info("The requested product is " + outputs.pt);
outputs.req=req;

})(inputs, outputs);

